package com.example.vinoteca.views;

import android.content.Context;
import android.content.Intent;
import android.os.Bundle;
import android.util.Log;
import android.view.Menu;
import android.view.MenuItem;
import android.view.View;
import android.widget.Toast;

import androidx.annotation.NonNull;
import androidx.appcompat.app.AppCompatActivity;
import androidx.appcompat.widget.Toolbar;
import androidx.recyclerview.widget.ItemTouchHelper;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import com.example.vinoteca.R;
import com.example.vinoteca.interfaces.ListInterface;
import com.example.vinoteca.models.WineEntity;
import com.example.vinoteca.presenters.ListPresenter;
import com.google.android.material.floatingactionbutton.FloatingActionButton;
import com.google.android.material.snackbar.Snackbar;

import java.util.ArrayList;

public class ListActivity extends AppCompatActivity implements ListInterface.View {
    String TAG = "Vinoteca/views/listActivity";
    private ListInterface.Presenter presenter;
    private Context myContext;
    private ArrayList<WineEntity> items;
    private WineAdapter adapter;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        Log.d(TAG, "Starting on create");
        super.onCreate(savedInstanceState);

        setContentView(R.layout.activity_list);
        Toolbar toolbar = findViewById(R.id.toolbar);
        setSupportActionBar(toolbar);
        getSupportActionBar().setTitle(R.string.menu);
        myContext = this;


        presenter= new ListPresenter( this);


        FloatingActionButton fab = findViewById(R.id.fab);
        fab.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                Log.d(TAG, "Click on  Floating button");
                presenter.onClickFloatingButton();
            }
        });

        items = new ArrayList<WineEntity>();
        WineEntity wine1=new WineEntity();
        wine1.setName("Pérez Pascuas Gran Reserva 1994");
        wine1.setCellar("Pérez Pascuas");
        wine1.setDenomination("Ribera del Duero");
        wine1.setImage("");
        WineEntity wine2=new WineEntity();
        wine2.setName("Azpilicueta Crianza 2016");
        wine2.setCellar("Azpilicueta");
        wine2.setDenomination("Rioja");
        wine2.setImage("");
        WineEntity wine3=new WineEntity();
        wine3.setName("Luis Cañas Crianza 2016");
        wine3.setCellar("Luis de Cañas");
        wine3.setDenomination("Rioja");
        wine3.setImage("");
        WineEntity wine4=new WineEntity();
        wine4.setName("Chivite las Fincas 2019");
        wine4.setCellar("Las fincas");
        wine4.setDenomination("Navarra");
        wine4.setImage("");
        WineEntity wine5=new WineEntity();
        wine5.setName("Mar de Frades 2019");
        wine5.setCellar("Bodega Frades");
        wine5.setDenomination("Rías Baixas");
        wine5.setImage("");
        WineEntity wine6=new WineEntity();
        wine6.setName("Protos Verdejo 2019");
        wine6.setCellar("Protos");
        wine6.setDenomination("Rueda");
        wine6.setImage("");
        WineEntity wine7=new WineEntity();
        wine7.setName("Moët & Chandon Brut Imperial");
        wine7.setCellar("Francia");
        wine7.setDenomination("Champagne");
        wine7.setImage("");
        WineEntity wine8=new WineEntity();
        wine8.setName("Mumm Cordon Rouge");
        wine8.setCellar("Francia");
        wine8.setDenomination("Champagne");
        wine8.setImage("");
        WineEntity wine9=new WineEntity();
        wine9.setName("Ramón Bilbao Edición Limitada 2017");
        wine9.setCellar("Ramon Bilbao");
        wine9.setDenomination("Rioja");
        wine9.setImage("");
        WineEntity wine10=new WineEntity();
        wine10.setName("De Casta Rosado 2018");
        wine10.setCellar("Torres");
        wine10.setDenomination("Catalunya");
        wine10.setImage("");

        items.add(wine1);
        items.add(wine2);
        items.add(wine3);
        items.add(wine4);
        items.add(wine5);
        items.add(wine6);
        items.add(wine7);
        items.add(wine8);
        items.add(wine9);
        items.add(wine10);
        // Inicializa el RecyclerView
        final RecyclerView recyclerView = (RecyclerView) findViewById(R.id.recyclerViewlist);

        // Crea el Adaptador con los datos de la lista anterior
        adapter = new WineAdapter(items);
        Log.d(TAG, "Getting items on adapter");

        // Asocia el elemento de la lista con una acción al ser pulsado
        adapter.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                // Acción al pulsar el elemento
                Log.d(TAG, "Click on element of recyclerview");
                int position = recyclerView.getChildAdapterPosition(v);
                Toast.makeText(ListActivity.this, "Posición: " + String.valueOf(position+1) + "\nName: " + items.get(position).getName() + " \nDenomination: " + items.get(position).getDenomination(), Toast.LENGTH_SHORT)
                        .show();//
                presenter.onClickRecyclerViewItem(items.get(position).getId());
            }
        });

        // Asocia el Adaptador al RecyclerView
        recyclerView.setAdapter(adapter);

        // Muestra el RecyclerView en vertical
        recyclerView.setLayoutManager(new LinearLayoutManager(this));
        //Swipe

        ItemTouchHelper helper = new ItemTouchHelper(new ItemTouchHelper.SimpleCallback(0, ItemTouchHelper.LEFT) {
            @Override
            public boolean onMove(@NonNull RecyclerView recyclerView, @NonNull RecyclerView.ViewHolder viewHolder, @NonNull RecyclerView.ViewHolder target) {
                return false;
            }

            @Override
            public void onSwiped(@NonNull RecyclerView.ViewHolder target, int direction) {
                Log.d(TAG, "On swiped");
                int position=target.getAdapterPosition();

                Toast.makeText(ListActivity.this, getString(R.string.deletedWine)+ ""+ items.get(position).getName(), Toast.LENGTH_SHORT).show();
                presenter.onSwipeRecyclerViewItem(position);

            }
        });

        helper.attachToRecyclerView(recyclerView);
    }





    @Override
    public boolean onCreateOptionsMenu(Menu menu) {
        // Inflate the menu; this adds items to the action bar if it is present.
        getMenuInflater().inflate(R.menu.menu_main, menu);
        Log.d(TAG, "Starting on create options menu");
        return true;
    }

    @Override
    public boolean onOptionsItemSelected(MenuItem item) {

        int id = item.getItemId();
        Log.d(TAG, "Starting options item selected");

        if (id == R.id.action_search) {
            Log.d(TAG, "Click on Searchmenu");
            presenter.onClickSearchButton();
            return true;
        }

        if (id == R.id.action_settings) {
            Log.d(TAG, "Click on Settingsmenu");
            return true;
        }
        if (id == R.id.action_about) {
            Log.d(TAG, "click on aboutmenu");
            presenter.onClickAboutButton();
        }
        if (id == R.id.action_help) {
            Log.d(TAG, "Click on helpmenu");
            return true;
        }
        if (id == R.id.action_orderBy) {
            Log.d(TAG, "Click on orderbymenu");
            return true;
        }

        return super.onOptionsItemSelected(item);
    }
    @Override
    public void startAboutActivity() {
        Log.d(TAG,"Starting About Activity");
        Intent intent = new Intent(getApplicationContext(), AboutActivity.class);
        startActivity(intent);
    }
    @Override
    public void startSearchActivity() {
        Log.d(TAG,"Starting Search Activity");
        Intent intent = new Intent(getApplicationContext(), SearchActivity.class);
        startActivity(intent);
    }
    @Override
    public void startFormActivity(){
        Log.d(TAG,"Starting FormActivity");
        Intent intent = new Intent(getApplicationContext(), FormActivity.class);
        startActivity(intent);

    }
    @Override
    public void startFormActivity(String id){
        Log.d(TAG,"Starting FormActivity with id...");
        Intent intent = new Intent(getApplicationContext(), FormActivity.class);
        intent.putExtra("id", id);
        startActivity(intent);
    }

    @Override
    public void removeRecyclerViewItem(int id) {
        Log.d(TAG, "Removing item swiped");
        items.remove(id);
        adapter.notifyItemRemoved(id);



    }

    @Override
    public void showToast(String error) {

    }

    @Override
    protected void onStart() {
        super.onStart();
        Log.d(TAG,"Starting onStart");
    }

    @Override
    protected void onResume() {
        super.onResume();
        Log.d(TAG,"Starting onResume");
    }

    @Override
    protected void onPause() {
        super.onPause();
        Log.d(TAG,"Starting onPause");
    }

    @Override
    protected void onStop() {
        super.onStop();
        Log.d(TAG,"Starting onStop");
    }

    @Override
    protected void onRestart() {
        super.onRestart();
        Log.d(TAG,"Starting onRestart");
    }

    @Override
    protected void onDestroy() {
        super.onDestroy();
        Log.d(TAG,"Starting onDestroy");
    }


}